import React from 'react';
import 'ldrs/ring';

const loading = () => {
   return (
     <div className="Loader-container">
       <div className="Loader"> Wait a second.....</div>
       <l-ring
       size="40"
       stroke="5"
       bg-opacity="0"
       speed="2" 
       color="black"> 
       </l-ring>
        
     </div>
   )
}

export default loading;
